import React from 'react';
import { Box, Grid } from '@material-ui/core';

const Footer = () => {
    return (
        <>
            <footer>
                <Box>
                    <Grid container>
                        <Grid></Grid>
                    </Grid>
                </Box>
            </footer>
        </>
    )
}

export default Footer
